 @ericlima8058  não viaja! Diniz tem um ótimo elenco nas mãos... O criticando Abel dominou o Flamengo nas finais com o mesmo time.

O próprio Rogério Ceni já disse que o Fluminense é o 4° melhor elenco do Brasil... Você só assiste esses comentaristas de São Paulo falarem merda, não tá vendo a qualidade de elenco que ele tem nas mãos.

Mérito dele, mas tem material pra fazer o trabalho... Diferente das outras equipes que ele treinou

 @ericlima8058  eu não quero que o Diniz saí do Fluminense. Ele faz um ótimo trabalho... Mas ele faz esse trabalho ótimo pq ele tem material, tem jogadores, tem boas peças no time e no banco.

Você acha mesmo que aqueles resultados péssimos no Fluminense em 19, Vasco em 21... Era só culpa do Diniz ? O time do Vasco era horrível, o treinador tinha uma parte de culpa, não toda

Assim como ele não tem todo o mérito no Fluminense pelos resultados, tem jogos que ele ganhou pela força do elenco... Inclusive o jogo anterior contra o Goiás

